    var adminbar = document.getElementById("adminpanel");
    var admintext = document.getElementById("admin_panel");
    admintext.innerHTML = "test worked";
    adminbar.style.animation = "pop_out 5s 1";
    setTimeout(function() {
        document.getElementById("adminpanel").style.visibility = "visible";
    }, 5000);
}

